  const APP_KEY = "d4e11b542aa313cbfe03a2432f57945b";
  const exampleReq = 
    `https://api.edamam.com/search?q=chicken&app_id=${APP_ID}&app_key=${APP_KEY}`;

  const [counter, setCounter] = useState(0);

  useEffect(() =>{
    console.log('Effect has been run');
  });

  return(
    <div className="App">
      <form className="search-form">
        <input className="search-form" type="text"/>
        <button onClick={() => setCounter(counter + 1)} className="search-buttom" type="submit">
          {counter}
        </button>
      </form>
    </div>
  );
};

export default App;
